import React, {useState} from 'react';
import './ParkingSpots.css'
import findIcon from '../../icons/findIcon.png'
import Spots from './Spots/Spots.js'
import {getBusiness} from '../../redux/actions/actions.js'

const axios = require('axios')

export default function ParkingSpots() {

  const [location, setLocation] = useState([])

  const getBusiness = (
    location,
    score
  ) => {
    return async (dispatch) => {
      try {
        const data = await axios.get(
          `${process.env.REACT_APP_BACKEND_URL}parkings?location=${location}&score=${score}`
        );
        let newData = data.response.parkings
          console.log(newData)
        // let newArrData = {pages: data.pages, business : newData};
  
        dispatch({
          type: 'GET_BUSINESS',
          payload: newData,
        });
      } catch (error) {
        dispatch({
          type: 'GET_BUSINESS',
          payload: {
            error: 'Not found',
          },
        });
      }
    };
  };

  const submit = (e) => {
    e.preventDefault()
    console.log(getBusiness(location))
    
  }



  return (
      <>
      <form onSubmit={submit} className='ParkingSpots'>
          <input id='locationInput' placeholder='address,neighborhood,city,state or zip...'
                onChange={(e)=> {setLocation(e.target.value)}}
          />
          <button>
            <img src={findIcon} id='findButton' alt='findIcon' />
          </button>
      </form>
      <Spots />
      </>
  )
}
